import { signInWithGoogle } from '../services/firebase';
import Button from 'react-bootstrap/Button';
import '../App.css';

const Login = () => {
  return (
    <div>
      <Button variant="outline-secondary" className="btn-outline.secondary" onClick={signInWithGoogle}>Sign in with Google</Button>
    </div>
  )
}

export default Login;
